import React from 'react';
import { View, StyleSheet } from 'react-native';
import Svg, { Path, Circle } from 'react-native-svg';

const SafeMitraLogo = ({ size = 100, color = '#FFFFFF' }) => {
  return (
    <View style={[styles.container, { width: size, height: size }]}>
      <Svg width={size} height={size} viewBox="0 0 100 100">
        {/* Shield Shape */}
        <Path
          d="M50 5L10 20V50C10 75 50 95 50 95C50 95 90 75 90 50V20L50 5Z"
          fill={color}
          stroke={color}
          strokeWidth="2"
        />
        {/* Female Symbol */}
        <Circle cx="50" cy="40" r="15" fill={color} />
        <Path
          d="M50 55L50 75M40 65H60"
          stroke="#FF3B30"
          strokeWidth="4"
          strokeLinecap="round"
        />
      </Svg>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    shadowColor: '#000',
    shadowOffset: {
      width: 0,
      height: 2,
    },
    shadowOpacity: 0.25,
    shadowRadius: 3.84,
    elevation: 5,
  },
});

export default SafeMitraLogo;
